import React, { Component } from 'react'

export class Posts extends Component {
    componentWillMount(){
        fetch('https://jsonplaceholder.typicode.com/posts')
        .then(res => res.json())

    }

    render() {
        return (
            <div>
                <h1>Posts component</h1>
            </div>
        )
    }
}

export default Posts
